BEGIN TRANSACTION;
CREATE TABLE categories (id integer PRIMARY KEY, pid integer NOT NULL, title text NOT NULL);
CREATE TABLE languages (id integer PRIMARY KEY, code text NOT NULL, title text NOT NULL);
CREATE TABLE relations (id integer PRIMARY KEY, wid integer NOT NULL, sid integer NOT NULL);
CREATE TABLE words (id integer PRIMARY KEY, en text NOT NULL, ru text NOT NULL, nl text NOT NULL, de text NOT NULL, fr text NOT NULL, es text NOT NULL, pl text NOT NULL, lt text NOT NULL, el text NOT NULL, hi text NOT NULL);
COMMIT;
